import logo from "./logo.svg";
import "./App.css";

function QuizPage() {
  return (
    <div>
      <header className="App-header">Quiz1</header>
      <p className="App-main">Please select a Quiz from the Quizzes section.</p>
      <p className="footer">This is the Footer</p>
    </div>
  );
}

export default QuizPage;
